//引入Vue
import Vue from 'vue'
//引入App
import App from './App.vue'
import { TabPane,Row } from "module";
//关闭Vue的生产提示
Vue.config.productionTip = false
//应用ElementUI
Vue.component("el-tab-pane",Tabs)
Vue.component("el-row",Row)
//创建vm
new Vue({
	el:'#app',
	render: h => h(App),
})
